    "# Simulation velocities via finite‐difference (np.gradient)\n",
    "df[\"spike_v\"]  = np.gradient(df[\"spike_y\"],  df[\"time\"])\n",
    "df[\"bubble_v\"] = np.gradient(df[\"bubble_y\"], df[\"time\"])\n",
    "\n",
